import React, { useEffect, useState } from "react";
import Navbar from "./Components/Navbar";
import loadingPic from './Components/bg.png'
import "./App.css";

function App() {
  const [load, setLoad] = useState(true);

  useEffect(() => {
    setTimeout(() => setLoad(true), 3000);
  }, []);

  return (
    <body>
      {
        load ? (
            <div className=" h-full w-full flex justify-center">
            <img src={loadingPic} className="bg-transparent m-0 flex" height={100} width={100} alt="logo pic" />
            </div>

        )
          :
          <Navbar />
      }
    </body>
  );
}

export default App;
